class App extends Component {
  constructor(props) {
    super(props)
    this.state={
      planets: {
        moon: [{ name: 'Jonaed', count: 0}, { name: 'Ashik', count: 0}],
        sun: [{ name: 'Mission', count: 0}, { name: 'Bayjid', count: 0}]
      }
    }
  }
  counterButtons = () => {
    console.log('this is just a simple button')
  }
  render() {
    return (
      <div className="App">
        <ul>
          { this.counterButtons }
        </ul>
      </div>
    );
  }
}

export default App;
